import Card from "../components/Card"
import {posts} from "../data"

const Home = ({ user }) => {
    return (
        <div className="home">
            {user ? (
                posts.map(post=>(
                    <Card key={post.id} post={post}/>
                ))
            ) : (
                <h1 className="loginTitle">Please Login to view posts</h1>
            )}
        </div>
    )
}

export default Home
